import defaultTemplate from './default';
import jakeResumeTemplate from './jake_resume';
import blankTemplate from './blank_template';

// Collection of all available templates
const templates = {
  default: {
    name: "High School Resume",
    description: "ATS-friendly format for high school students applying to colleges",
    template: defaultTemplate
  },
  jake: {
    name: "Professional Resume",
    description: "Clean, well-structured format optimized for job applications",
    template: jakeResumeTemplate
  },
  blank: {
    name: "Blank Template",
    description: "Start from scratch with a customizable blank template",
    template: blankTemplate
  }
};

export default templates;
